import React from 'react'

export default function Skils() {
  return (
    <div className="skill">
        <hr></hr>
        <h3>Skills</h3>
        <ul>
            <li>
                <strong>Programming Languages:</strong>  C, C++, Python, Javascript, HTML, CSS
            </li>
        </ul>

        <style>
            {`

               .skill{
                background-color:#f0f0f0;
                padding:10px;
               }
               
               .skill hr{
                border-width: 2px;
                font-weight: bold;
               }

              .skill h3{
                text-align: left;
                margin-left:14px:
                font-size:25px;
                color: #333;
                font-family:'Times New Roman',Times,serif;
              }
            `}
        </style>
    </div>
  )
}
